A classic problem in TypeScript!

You're referring to a situation where the type system allows for multiple possible types, but you have domain knowledge that narrows it down to a single type in practice. This is called a "type guard" or "narrowing" scenario.

In TypeScript, you can use various techniques to convey this information to the type system. Here are a few approaches:

1. **Type Assertions** (`as` keyword):
```ts
let value: string | number;
if (/* some condition */) {
  value = 'hello'; // value is now known to be string
} else {
  value = 42; // value is never reached, but type checker knows it's string | number
}
const definiteString: string = value as string; // type guard
```
Type assertions tell the compiler that you know the value has a specific type at this point, despite the original type annotation being a union type. However, keep in mind that if the condition is ever false, the type assertion will not prevent an error at runtime.

2. **User-Defined Type Guards**:
You can create a function that returns a type predicate, which is a function that returns a boolean value indicating whether the input value satisfies a certain condition. The type checker will infer that the type of the input value is narrowed when the predicate returns `true`.

Example:
```ts
type IsString = { value: string };

function isString(value: string | number): value is string {
  return typeof value === 'string';
}

let value: string | number;
if (isString(value)) {
  const definiteString: string = value; // type is now string
}
```
In this example, the `isString` function is a type guard that returns a type predicate. When called with a value of type `string | number`, the type checker infers that the type of `value` is `string` inside the `if` block.

3. **Type Predicates with Enums or Literals**:
If you're working with enums or literal types, you can use a more explicit type predicate function.

Example:
```ts
enum Color { Red, Green, Blue }

type IsRed = { color: Color };
function isRed(value: Color): value is IsRed & { color: Color.Red } {
  return value === Color.Red;
}

let color: Color;
if (isRed(color)) {
  const definiteRed: Color.Red = color; // type is now Color.Red
}
```
4. **Advanced: Mapped Types and Conditional Types**:
For more complex scenarios, you can use mapped types and conditional types to create a type that reflects the narrowed type.

Example:
```ts
type UnionToIntersection<T, K extends ((...args: any[]) => T)[]> = K extends [(infer U) => any]
  ? U
  : never;

type NarrowedType<T, P> = P extends ((value: T) => value is infer U) ? U : never;

type MyValue = string | number;
type Narrowed = NarrowedType<MyValue, (value: MyValue) => value !== null && value !== undefined>;

let value: MyValue;
if (/* some condition */) {
  const definiteNarrowed: Narrowed = value; // type is now narrowed
}
```
In this example, `NarrowedType` is a type function that takes a value type `T` and a type predicate function `P` as arguments. It returns the narrowed type `U` if the predicate is true, or `never` otherwise.

Remember to choose the approach that best fits your use case, and happy typing!

